import React from "react";
import logo from "./../images/logo.png";
import {
  Card,
  CardImg,
  Collapse,
  Navbar,
  NavbarToggler,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
} from "reactstrap";

export default class Footer extends React.Component {
  render() {
    return (
      <div>
        <Navbar color="light" light expand="md">
              <NavItem>
                <Card>
                  <CardImg src={logo} className="h-25 w-25 embbed-responsive "></CardImg>
                </Card>
              </NavItem>
              <NavItem>
                <NavLink href="https://github.com/reactstrap/reactstrap">
                  GitHub
                </NavLink>
              </NavItem>
        </Navbar>
      </div>
    );
  }
}
